import React from 'react';
import Title from '../Title/Title';
import errow from '../../assets/arrowRight.svg';

const Hero = () => {
   return (
      <div className='hero container'>
         <div className='hero__title'>
            <Title headingStyle='bolder--800' headingSize='heading--h1'>
               {' '}
               <h1>
                  Website and user interface designer.{' '}
                  <img className='hero__arrow' src={errow} />{' '}
               </h1>{' '}
            </Title>

            <div >
               <svg viewBox='0 0 100 100' width='150' height='150'>
                  <defs>
                     <path
                        id='circle'
                        d='
        M 50, 50
        m -37, 0
        a 37,37 0 1,1 74,0
        a 37,37 0 1,1 -74,0'
                     />
                  </defs>
                  <text font-size='17'>
                     <textPath href='#circle'>GHOFRANE BEN HMAID.</textPath>
                  </text>
               </svg>
            </div>
         </div>
      </div>
   );
};

export default Hero;
